import {
  AppBar,
  Box,
  Button,
  IconButton,
  Toolbar,
  Typography,
} from "@mui/material";
import MyButton from "./MyButton";

const Header = () => {
  return (
    <>
      <AppBar color="secondary">
        <Toolbar>
          <Box mx={2}>
            <IconButton></IconButton>
          </Box>

          <Typography style={{ color: "white", fontWeight: "bold" }}>
            견적비교
          </Typography>
          <Typography style={{ color: "white", fontWeight: "bold" }}>
            핸드캐리
          </Typography>
          <Typography style={{ color: "white", fontWeight: "bold" }}>
            마이페이지
          </Typography>
          <MyButton value="Log In/Sign In" />
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
